import React from 'react';

function MyAccount(props) {
  const { user } = props;

  if (!user) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>{user.username}</h1>
      <p>{user.email}</p>
      <img src={user.image} alt='Profile Pic'/>
    </div>
  );
}


export default MyAccount;
